import React, {useState} from 'react';

export default props => {

	const [value, setValue] = useState({login: "", password: ""});

	const changeHandler = (param) => (event) => {
    	//debugger
    	param === "id" ? value[param] = +event.target.value : value[param] = event.target.value;
        setValue(value);
        activateButton();
    }


	return(
		<form>
			<div class="form-group">
			  	<label for="exampleInputEmail1">Email address</label>
			  	<input type="email" class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter email" onChange={changeHandler("login")}/>
			  	<small id="emailHelp" class="form-text text-muted">We'll never share your email with anyone else.</small>
			</div>
			<div class="form-group">
			  	<label for="exampleInputPassword1">Password</label>
		   		<input type="password" class="form-control" id="exampleInputPassword1" placeholder="Password" onChange={changeHandler("password")}/>
			</div>
			<div class="form-check">
			  	<input type="checkbox" class="form-check-input" id="exampleCheck1"/>
			  	<label class="form-check-label" for="exampleCheck1">Check me out</label>
			</div>
			<button type="submit" class="btn btn-primary">Submit</button>
		</form>
	)
}
